import React from 'react';
import { Outlet } from 'react-router-dom';

import CountryDetailsNavigation from '../components/Countries/CountryDetailsNavigation';

export default function CountryRoot() {
	return (
		<>
			<CountryDetailsNavigation />
			<Outlet />
		</>
	);
}
